import React from 'react';

class Screen extends React.Component {
    render() {
        return (
            <div className="screen">
                <h2></h2>
                <input type="text" screenValue={this.props.value} disabled onChange={this.props.handleScreenChange} />
            </div>
        )
    }
}

export default Screen;
